import React from 'react';
import Movie from '../Movie/movie';
const MovieList = ({ movies }) => {
  return (

    <div className="movie-list">
      {movies.map((movie) => (
         <div className="movie-list">
         {movies.map((movie) => (

           <Movie movie={movie} key={movie.id} />

         ))}
       </div>
      ))}
    </div>
  );
};
 console.log(movies)
export default MovieList;
